import React from 'react';
import {HomePageContainer, StatementContainer} from './homepage.styles';
import {ReactComponent as ActionStatement} from '../../assets/call-to-action';

const HomePage = () => {
    return <HomePageContainer>
        <StatementContainer>
        <span><ActionStatement/></span>
        </StatementContainer>
    </HomePageContainer>
}
export default HomePage;
